import React from 'react'
import { Jumbotron } from 'reactstrap';

function Home() {
    return (
        <div>
        <Jumbotron class='text-center'>
        <h1>Welcome to Employee Entity</h1>
        <p className="lead">This is a user interface for all the funtionalities provided by employee entity</p>
        <hr className="my-2" />
        <p>Hope you like it</p>
      </Jumbotron>
        </div>
    )
}

export default Home
